--------------------- Script for Productizing Deactivate Property ---------------------------

INSERT INTO EG_SCRIPT(ID,NAME,SCRIPT_TYPE,SCRIPT) VALUES(EG_SCRIPT_SEQ.NEXTVAL,'DeactivateOrderNum.generator','python',
'from org.apache.commons.lang import StringUtils '||CHR(13)||
'from org.egov.infstr.utils import SequenceGenerator '||CHR(13)||
'from java.util import Date '||CHR(13)||
'from org.egov.infstr import ValidationError '||CHR(13)||
'from org.egov.infstr import ValidationException '||CHR(13)||
'zone = StringUtils.leftPad(zoneBndry.getBoundaryNum().toString(),2,"0") '||CHR(13)||
'ward = StringUtils.leftPad(wardBndry.getBoundaryNum().toString(),3,"0") '||CHR(13)||
'today=Date() '||CHR(13)||
'finYear=scriptService.findAllBy(''SELECT a.finYearRange FROM CFinancialYear a,CFiscalPeriod b WHERE    a.id=b.financialYearId AND ? BETWEEN b.startingDate AND b.endingDate'',[today]) '||CHR(13)|| 
'if not finYear: raise  ValidationException,[ValidationError(''FINANCIALYEAR'',''Financial year is not defined in the system'')] '||CHR(13)||
'fYear=finYear[0] '||CHR(13)||
'year = fYear[2:4]+"-"+fYear[(len(fYear)-2):(len(fYear))] '||CHR(13)||
'sequenceGenerator = SequenceGenerator() '||CHR(13)||
'wardBdry = str(wardBndry.getBoundaryNum()) '||CHR(13)||
'runningNo=str(sequenceGenerator.getNextNumber("DDIV-"+wardBdry).getNumber()) '||CHR(13)||
'formattedRunningNo=StringUtils.leftPad(runningNo,4,"0") '||CHR(13)||
'result="D/"+zone+"/"+ward+"/"+year+"/"+formattedRunningNo ');  




